impl From<&str> for C {
    #[inline(always)]
    fn from(key: &str) -> Self {
        KEYS.get(key).unwrap().clone()
    }
}

impl From<u16> for C {
    #[inline(always)]
    fn from(x: u16) -> Self {
        unsafe { std::mem::transmute(x as u8) }
    }
}

// C == u16
impl PartialEq<u16> for C {
    #[inline(always)]
    fn eq(&self, x: &u16) -> bool {
        *self == C::from(*x)
    }
}

// u16 == C
impl PartialEq<C> for u16 {
    #[inline(always)]
    fn eq(&self, x: &C) -> bool {
        *x == *self
    }
}
